import 'bootstrap/dist/css/bootstrap.min.css';
import React from 'react';
import './App.css'
import { BrowserRouter,Routes ,Route} from "react-router-dom";
import MyNavbar from './omsOrderComponent/MyNavbar';
import ReadOrderDetails from './omsOrderComponent/ReadOrderDetails'
import PlaceOrder from './omsOrderComponent/PlaceOrder';
import UpdateOrder from './omsOrderComponent/UpdateOrder';
import Modal from './omsOrderComponent/Modal'


function App() {
    return (
      <div className="App">
        <div style={{background:"#00FFFF", height:"50px", color:"white", textAlign:"center", font:"20px"}}>WELCOME TO ORDER MANAGEMENT SYSTEM</div>
        <MyNavbar/>
        <Modal/>
           <BrowserRouter>
                <Routes>
                    <Route exact path="/readorders" element={<ReadOrderDetails/>} />
                    <Route exact path="/placeorder" element={<PlaceOrder/>} />
                    <Route exact path="/updateorder" element={<UpdateOrder/>} />
                </Routes>
          </BrowserRouter>
      </div>
    );
  }
  export default App;
